import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom'
function App() {
  return (
    <>
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to='/'>
                  Home
                </Link>
              </li>
              <li>
                <Link to='/about'>
                  About
                </Link>
              </li>
            </ul>
          </nav>
        </div>
        <Switch>
          <Route path='/about'>
            <About />
          </Route>
        </Switch>
      </Router>
    </>
  );
}
function About() {
  return (
    <h1>Welcome to About</h1>
  );
}
export default App;
